import React from 'react';
import { MDBListGroup, MDBListGroupItem } from 'mdb-react-ui-kit';

export default function App() {
  return (
    <div  className='all-services' style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '100vh' }}>
        <div>
            <h1 style={{marginLeft:50}}>ALL SERVICES</h1>
        <div className='mani' 
        style={{
            display: "grid",
            gridTemplateColumns: "40% auto",
            alignItems: "center", 
            marginRight: 50,
          }}
        >
            <div>
            <img src="/images/image3.avif" alt="aboutus" style={{width: "50%", marginLeft:"200px"}}/>
            </div>
            <div>
            <MDBListGroup style={{ minWidth: '22rem' }} light className='mb-3'>
        <MDBListGroupItem>
            <h2 style={{marginBottom:50}}>- Manicures -</h2>
          <h5 className='fw-bold'>Basic Manicure</h5>
          <p className='text-muted mb-0'>
          Includes the basic cleaning of toe nails with cuticles trimmed, nails shaping, light exfoliation, massage and choice of polish
          </p>
        </MDBListGroupItem>
        <MDBListGroupItem>
          <h5 className='fw-bold'>Spa Manicure</h5>
          <p className='text-muted mb-0'>
            Quisque ornare dui nibh, sagittis egestas nisi luctus nec. Sed aliquet laoreet sapien, eget
            pulvinar lectus maximus vel. Phasellus suscipit porta mattis.
          </p>
        </MDBListGroupItem>
        <MDBListGroupItem>
          <h5 className='fw-bold'>Deluxe Manicure</h5>
          <p className='text-muted mb-0'>
            Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Nulla
            ullamcorper arcu lacus, maximus facilisis erat pellentesque nec. Duis et dui maximus dui aliquam
            convallis. Quisque consectetur purus erat, et ullamcorper sapien tincidunt vitae.
          </p>
        </MDBListGroupItem>
      </MDBListGroup>
            </div>
        </div>
      {/* <MDBBtn outline rounded rippleColor='dark' color='dark' className='w-100'>
        View all
      </MDBBtn> */}
    </div>
    </div>
  );
}
